import React from "react";
import "./styles.scss";
import logo from "../../images/ME-LOGO.png";
import Hamburger from "../Hamburger/Hamburger";
import StyledButtonLink from "../StyledButtonLink/StyledButtonLink";

const NavigationBar = () => {
  return (
    <header>
      <div className="nav">
        <div>
          <a href="#top">
            MAISIEMBLETON
          </a>
        </div>
        <div className="nav-links">
          <a href="#about">ABOUT</a>
          <a href="#work">WORK</a>

          <StyledButtonLink variant="outlined" size="medium">
            SAY HI
          </StyledButtonLink>
          {/* <ButtonLink name="Say Hi!" link="mailto:maisiembleton@gmail.com" /> */}
        </div>
        <div className="nav-hamburger">
          <Hamburger />
        </div>
      </div>
    </header>
  );
};

export default NavigationBar;
